
CREATE TABLE postal_districts (postal_district INTEGER, postal_sector VARCHAR(MAX) /* comma separated list of first 2 digits of postal codes */, general_location VARCHAR(MAX) /* comma separated list of district names */);

CREATE TABLE pri_schools (school_name VARCHAR(MAX),
 url_address VARCHAR(MAX),
 address VARCHAR(MAX),
 postal_code INTEGER, telephone_no INTEGER, telephone_no_2 VARCHAR(MAX),
 fax_no INTEGER, fax_no_2 VARCHAR(MAX),
 email_address VARCHAR(MAX),
 mrt_desc VARCHAR(MAX) /* comma separated list of nearest MRT stations */, bus_desc VARCHAR(MAX) /* comma separated list of bus services */, principal_name VARCHAR(MAX),
 first_vp_name VARCHAR(MAX),
 second_vp_name VARCHAR(MAX),
 third_vp_name VARCHAR(MAX),
 fourth_vp_name VARCHAR(MAX),
 fifth_vp_name VARCHAR(MAX),
 sixth_vp_name VARCHAR(MAX),
 dgp_code VARCHAR(MAX) /* name of district, development guide plan */, zone_code VARCHAR(MAX) /* name of zone, can only be 'NORTH', 'SOUTH', 'EAST', 'WEST' */, type_code VARCHAR(MAX) /* type of school, can only be 'GOVERNMENT SCHOOL', 'GOVERNMENT-AIDED SCH', 'INDEPENDENT SCHOOL', 'SPECIALISED SCHOOL' */, nature_code VARCHAR(MAX) /* gender mix of school, can only be 'CO-ED SCHOOL', 'BOYS'' SCHOOL', 'GIRLS'' SCHOOL' */, session_code VARCHAR(MAX) /* type of session, can only be 'FULL DAY', 'SINGLE SESSION', 'DOUBLE SESSION' */, mainlevel_code VARCHAR(MAX) /* level of school, can only be 'PRIMARY', 'SECONDARY', 'JUNIOR COLLEGE', 'MIXED LEVELS', 'CENTRALISED INSTITUTE' */, sap_ind VARCHAR(MAX) /* whether school is a Special Assistance Plan school, can only be 'Yes', 'No' */, autonomous_ind VARCHAR(MAX) /* whether school is an Autonomous school, can only be 'Yes', 'No' */, gifted_ind VARCHAR(MAX) /* whether school is a Gifted Education Programme school, can only be 'Yes', 'No' */, ip_ind VARCHAR(MAX) /* whether school offers Integrated Programme, can only be 'Yes', 'No' */, mothertongue1_code VARCHAR(MAX) /* first language taught in school, can only be 'Chinese', 'Malay', 'Tamil' */, mothertongue2_code VARCHAR(MAX) /* second language taught in school, can only be 'Chinese', 'Malay', 'Tamil' */, mothertongue3_code VARCHAR(MAX) /* third language taught in school, can only be 'Chinese', 'Malay', 'Tamil' */);

CREATE TABLE condos (project_name VARCHAR(MAX) /* name of condo */, transacted_price_dollar INTEGER /* transacted sale price in dollars */, area_sqft FLOAT /* area in square feet */, unit_price_dollar_psf INTEGER /* unit sale price in dollars per square foot */, sale_date VARCHAR(MAX) /* date of sale in the format 'MMM-YY' e.g. 'Jan-20' */, street_name VARCHAR(MAX),
 type_of_sale VARCHAR(MAX) /* type of sale, can only be 'New Sale', 'Sub Sale', 'Resale' */, type_of_area VARCHAR(MAX) /* type of area, can only be 'Strata', 'Land' */, area_sqm INTEGER /* area in square meters */, unit_price_dollar_psm INTEGER /* unit sale price in dollars per square meter */, nett_pricedollar VARCHAR(MAX) /* ignore this column */, property_type VARCHAR(MAX) /* type of property, can only be 'Condominium', 'Apartment' */, number_of_units INTEGER, tenure VARCHAR(MAX) /* tenure of property, can only be 'Freehold', '99 yrs lease commencing from XXXX', 'XXX yrs lease commencing from XXXX' */, postal_district INTEGER /* postal district number */, market_segment VARCHAR(MAX) /* market segment, can only be 'Outside Central Region', 'Core Central Region', 'Rest of Central Region' */, floor_level VARCHAR(MAX) /* floor level of unit, in the format 'XX to XX' e.g. '01 to 05' */);

CREATE TABLE exec_condos (project_name VARCHAR(MAX) /* name of executive condo */, transacted_price_dollar INTEGER /* transacted sale price in dollars */, area_sqft FLOAT /* area in square feet */, unit_price_dollar_psf INTEGER /* unit sale price in dollars per square foot */, sale_date VARCHAR(MAX) /* date of sale in the format 'MMM-YY' e.g. 'Jan-20' */, street_name VARCHAR(MAX),
 type_of_sale VARCHAR(MAX) /* type of sale, can only be 'New Sale', 'Sub Sale', 'Resale' */, type_of_area VARCHAR(MAX) /* type of area, can only be 'Strata', 'Land' */, area_sqm INTEGER /* area in square meters */, unit_price_dollar_psm INTEGER /* unit sale price in dollars per square */, nett_pricedollar VARCHAR(MAX) /* ignore this column */, property_type VARCHAR(MAX) /* type of property, can only be 'Executive Condominium' */, number_of_units INTEGER, tenure VARCHAR(MAX) /* tenure of property, can only be '99 yrs lease commencing from XXXX' */, postal_district INTEGER /* postal district number */, market_segment VARCHAR(MAX) /* market segment, can only be 'Outside Central Region', 'Core Central Region', 'Rest of Central Region' */, floor_level VARCHAR(MAX) /* floor level of unit, in the format 'XX to XX' e.g. '01 to 05' */);

CREATE TABLE rental (project_name VARCHAR(MAX) /* name of property */, street_name VARCHAR(MAX),
 postal_district INTEGER /* postal district number */, property_type VARCHAR(MAX) /* type of property, can only be 'Non-Landed Properties' */, no_of_bedroom INTEGER, monthly_rent_dollar VARCHAR(MAX) /* monthly rent in dollars */, floor_area_sqm VARCHAR(MAX) /* floor area in square meters */, floor_area_sqft VARCHAR(MAX) /* floor area in square feet */, lease_commencement_date VARCHAR(MAX) /* date of lease commencement in the format 'MMM-YY' e.g. 'Jan-20' */);


